import React , {useState} from 'react'

export default function State() {
 const [value,setValue]=useState(0)

 function update(){
    //setValue('salma')
    setValue(prev=>prev+1)
 }
 function updateDown(){
    //setValue('salma')
    setValue(prev=>prev-1)
 }
  return (
    <div>
       <h1>{value}</h1>
    <button onClick={update}>+</button>
    <button onClick={updateDown}>-</button>
    </div>
  )
}
